-- ----------------------------
--  Procedure structure for `generer_abonnement_client`
-- ----------------------------
DROP PROCEDURE IF EXISTS `generer_abonnement_client`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `generer_abonnement_client`(p_date_base DATE, p_nb_abonnement MEDIUMINT, p_revue_id SMALLINT)
BEGIN

SET @interval := (SELECT DATEDIFF(CURDATE(),p_date_base));
SET @date_abon := DATE_ADD(p_date_base, INTERVAL ROUND(RAND()* @interval) DAY);

INSERT INTO abonnement_client 
(num_abonne, offre_id, date_abonnement, montant, premier_numero, dernier_numero)
SELECT 
	t.num_abonne
	,t.offre_id
	,t.date_abonnement
	,t.tarif
	,IF(t.dernier_numero_abonne is null OR t.dernier_numero_abonne < t.premier_numero,
		t.premier_numero,
		t.dernier_numero_abonne + 1
	) as premier_numero
	
	,IF(t.dernier_numero_abonne is null OR t.dernier_numero_abonne < t.premier_numero,
		t.premier_numero + t.nb_numeros -1,
		t.dernier_numero_abonne + t.nb_numeros
	) as dernier_numero
FROM
(
SELECT 
	client.num_abonne
	,offre_abonnement.id as offre_id
	,@date_abon := DATE_ADD(p_date_base, INTERVAL ROUND(RAND()* @interval) DAY) as date_abonnement
	,offre_abonnement.tarif
	,offre_abonnement.nb_numeros
	,(SELECT MIN(numero) FROM echeance_revue 
		WHERE echeance_revue.revue_id = offre_abonnement.revue_id
		AND echeance_revue.date_parution > @date_abon
	) as premier_numero
	,(SELECT MAX(dernier_numero) FROM abonnement_client as ac 
		INNER JOIN offre_abonnement as oa
		ON ac.offre_id = oa.id
		WHERE ac.num_abonne = client.num_abonne
		AND oa.revue_id = offre_abonnement.revue_id
	) as dernier_numero_abonne

FROM offre_abonnement, client
WHERE offre_abonnement.revue_id = p_revue_id
ORDER BY RAND()
LIMIT p_nb_abonnement
) as t;

END
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `generer_echeancier_revue`
-- ----------------------------
DROP PROCEDURE IF EXISTS `generer_echeancier_revue`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `generer_echeancier_revue`(id_revue SMALLINT, date_debut DATE, nb_numeros SMALLINT)
BEGIN

SET @numero = 0;
SET @double = false;

# Supression de l'échéancier de la revue
DELETE FROM echeance_revue WHERE echeance_revue.revue_id = id_revue;

# Récupération de l'intervalle en fonction de la périodicité
SELECT intervalle, mois_numero_double FROM periodicite 
INNER JOIN revue ON revue.periodicite_id = periodicite.id
WHERE revue.id = id_revue INTO @intervalle, @mois_numero_double;

SET @date_parution = date_debut;

# Boucle sur l'ensemble des numéros à générer
REPEAT
	SET @numero = @numero + 1;
	
	# Insertion d'un numéro dans l'échéancier
	INSERT INTO echeance_revue 
	(revue_id, numero, date_parution)
	VALUES (id_revue, @numero, @date_parution);

/*Définition de la date de parution 
        en fonction de la périodicité
        de la date de début et du numéro
    */

	IF @mois_numero_double is not null THEN
		SET @double =  MOD(@numero,@mois_numero_double) = 0;
	END IF;

	IF @double = TRUE THEN
		SET @date_parution = DATE_ADD(@date_parution, INTERVAL (@intervalle)+1 MONTH);
	ELSE 
		SET @date_parution = DATE_ADD(@date_parution, INTERVAL (@intervalle) MONTH);
	END IF;
	
UNTIL @numero = nb_numeros
END REPEAT;

END
 ;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
